import React from "react";
import axios from "axios";

const MainBody = () => {
  const handleProducts = async () => {
    const options = {
      method: "GET",
      url: "https://apple-model-lookup.p.rapidapi.com/api/v1/models/A1366",
      headers: {
        "X-RapidAPI-Key": "6e8ab4063dmsh342dec66884015ep1a73ccjsn0f32318aee6e",
        "X-RapidAPI-Host": "apple-model-lookup.p.rapidapi.com",
      },
    };
    try {
        const data = await axios.get(options);
        console.log(data);
    } catch (error) {
        console.log(error);
    }
  };
  return (
    <div>
        <button>click</button>
    </div>
  )
};

export default MainBody;
